    "# draw Healthcare comparison graph\n",
    "data = getHealthCareDataFromDatabase()\n",
    "drawSpriderGraph(data, ('Trump', 'Sanders'))\n",
    "\n",
    "# draw Immigration comparison graph\n",
    "data = getImmigrationDataFromDatabase()\n",
    "drawSpriderGraph(data, ('Trump', 'Sanders'))\n",
    "\n",
    "# draw Veteran's comparison graph\n",
    "data = getVeteransDataFromDatabase()\n",
    "drawSpriderGraph(data, ('Trump', 'Sanders'))"
